import React , {useState,useEffect} from 'react';
import {  useNavigate } from "react-router-dom";
import axios from 'axios';
import {Link} from "react-router-dom";

function HomeScreen() {
   const [products, setProducts] = useState([]);
   const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/products');
        // console.log("hi",response)
        setProducts(response.data);
      } catch (error) {
        console.error('Error fetching products:', error);
      }
    };

    fetchData();
  }, []);
  return (
      <div>
        {/* <header>
          <a href="/">pipcorn</a>
        </header> */}
        <main>
           {/* <Routes>
            <Route path="/productscreen" element={<ProductScreen />} /> 
             <Route path="/" element={<HomeScreen />} /> 
          </Routes>  */}
          <h1>Featured Products</h1>
          <img src ="https://www.iconpacks.net/icons/2/free-user-icon-3296-thumb.png" className='icon' alt=" " onClick={()=>navigate("/account")} />
          <div className="products">
            {products.map((product) => (
              <div className= "product" key={product._id}>

                <a href={`/product/${product._id}`}>
                  <img src={product.image} alt={product.name} />
                </a>
                <div className="prod-info">
                  <a href={`/product/${product._id}`}>
                    {/* <p>{product.name}</p> */}
                  </a>
                  <p>{product.name}</p>
                  <p>
                    <strong>Price : $ {product.price}</strong>
                  </p>
                  {/* <p>
                    <strong>{product.pid}</strong>
                  </p> */}
                  {/* {/ <button >Add to cart</butt */}
                  {/* <a href={`/product/${product._id}`} >Add to cart</a> */}



                </div>
              </div>
            ))}
          </div>
        </main>
        <Link to="/logout" >Logout</Link>
      </div>
  );
}

export default HomeScreen
